    "from scipy.stats import chi2_contingency\n",
    "import pandas as pd\n",
    "\n",
    "# Load data\n",
    "df = pd.read_excel(r'C:\\Users\\60113\\Desktop\\FYPdataset_cleaned.xlsx')\n",
